import './Home.css'
import Header from '../header/Header'
import About from '../about/About';
import Features from '../features/Features';
import Pricing from '../pricing/Pricing';

export default function  Home() {
  return (
    <div>
      <Header />
      <About />
      <Features />
      <Pricing />
    </div>
  );
}
